import React from 'react'
import { Text, View } from 'react-native'

const Entrenador = () => {
    console.log('Está mostrando la vista de Entrenador')
    return (
        <View style = {{margin}}>
            <Text>
                vista del entrenador
            </Text>
        </View>
    )
}

export default Entrenador
